</html>

<script>
    function Login() {
        var logger = true;

        if ($(""#user"").val() == """") {
            iziToast.warning({
                title: 'Advertencia',
                message: 'El Campo Nombre Usuario es requerido',
                position: 'topRight',
            });
            logger = false;
        }

        if ($(""#pass"").val() == """") {
            iziToast.warning({
                title: 'Advertencia',
                message: 'El Campo Contraseña es requerido',
                position: 'topRight',
            });
            logger = false;
        }


        if (logger) {

            iziToast.show({
                title: ' ',
                message: 'Iniciando Sesión',
                position: 'topRight',
                timeout: 3000,
                close: false,
            });

            setTimeout(function () {
                if (logger) {
                    $(""#login"").submit();
                }
            }, 2000);
        }
    }
</script>

